// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

//   
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract TRON is ERC20, Ownable {
    AggregatorV3Interface internal priceFeed; //      Chainlink
    uint256 public tokenPrice; //    USD (  )
    string private tokenImageURL; // URL  

    //  
    constructor() ERC20("USDTALEX", "TRX") Ownable(msg.sender) {
        tokenPrice = 1 * 10**18; //    (, 1 USD)
        priceFeed = AggregatorV3Interface(0x5f4eC3Df9cbd43714FE2740f5E3616155c5b8419); //  Chainlink Oracle (  )
        _mint(msg.sender, 1000000 * 10**decimals()); //    
    }

    //       Chainlink
    function updateTokenPrice() public {
        int price = getPrice(); //    Chainlink
        require(price > 0, "Invalid price"); // ,   
        tokenPrice = uint256(price); //   
    }

    //      Chainlink
    function getPrice() public view returns (int) {
        (
            /* uint80 roundID */,
            int price,
            /* uint startedAt */,
            /* uint timeStamp */,
            /* uint80 answeredInRound */
        ) = priceFeed.latestRoundData(); //    Oracle
        return price;
    }

    //    URL   (  )
    function setTokenImageURL(string memory _url) public onlyOwner {
        tokenImageURL = _url;
    }

    //    URL  
    function getTokenImageURL() public view returns (string memory) {
        return tokenImageURL;
    }
}
